INSERT INTO `v10` VALUES (11600,'earliest monumental ritual art (Shigir, Siberia): 5-m tall larchwood plank carved with human forms and signs → complex ideas expressed by hunter-gatherers'),(11700,'in the Mojave desert a seed germinates and grows into a deadly creosote bush, which segments to sprout new stems, sprouting and segmenting for 11,700 years'),(12000,'extinction of megafauna including woolly mammoths from continental Eurasia and North America, caused by human hunting and climate change'),(12800,'climate shift contributing to megafaunal extinctions and human cultural changes (Younger Dryas): triggered by a comet airburst over North America and Europe?'),(14000,'earliest lime plaster, used as an adhesive for hafting (Kebaran, Levant) → mortar by 3,000 years ago'),(15000,'earliest thaumatrope (Laugerie-Basse, France): an optical toy, creating movement by juxtaposition of images'),(19000,'replacement of early modern humans across Eurasia by the ancestors of today’s populations'),(200000,'earliest adhesive: birch tar used by Neanderthals for hafting stone tools (Campitello, Italy) → pyrotechnology'),(250000,'replacement of Homo heidelbergensis by Homo neanderthalensis in Europe, and by Homo sapiens in Africa over the subsequent 100,000 years'),(315000,'earliest representatives of our species, Homo sapiens (Jebel Irhoud, Morocco): facial and dental structure similar to modern humans, yet still archaic elongation of the braincase'),(400000,'earliest evidence of food storage for later consumption: bone marrow (Qesem Cave, Israel) → food economy, incentivised by anticipation of future need'),(430000,'Denisovans diverge from Neanderthals (southern Siberia) → Tibetan Plateau and Laos by 160,000 years ago; subsequent interbreeding, possibly also with Homo erectus'),(500000,'earliest use of stone-tipped spears, by Homo heidelbergensis (South Africa) for hunting large game'),(700000,'rise of Homo heidelbergensis in Africa and Europe, possible ancestor of Homo sapiens and Homo neanderthalensis; supplementing meat with starchy plants');
